import React,{useState, useEffect,Fragment} from 'react';
const Practice = () =>{
const [ profile, setProfile ] = useState({
  name:'',
  age:0
})
const {name, age} = profile;
  return(
    <Fragment>
      <input type = 'submit'  value = 'Increment' onClick = { (e) => setProfile({...profile, age:age+1})}/>
      <input type = 'submit'  value = 'Decrement' onClick = { (e) => setProfile({...profile, age:age-1})}/>
      <h1>Age: {age}</h1>
    </Fragment>
  )
}

export default Practice;
